import React from 'react';
const SvgMiss = () => (
  <g>
    <line x1="0.2" y1="0.2" x2="0.8" y2="0.8" stroke="white" strokeWidth="0.05" />
    <line x1="0.8" y1="0.2" x2="0.2" y2="0.8" stroke="white" strokeWidth="0.05" />
  </g>
);

export default SvgMiss;
